import { DEFAULT_PROFILE_IMAGES, DEFAULT_NAME_PREFIXES, DEFAULT_NAME_SUFFIXES } from "./Constant";

const getRandom = (min, max) => Math.floor(Math.random() * (max - min)) + min;

export const getRandomUserIcon = () => {
  return DEFAULT_PROFILE_IMAGES[getRandom(0, DEFAULT_PROFILE_IMAGES.length)];
}

export const getRandomName = () => {
  const prefix = DEFAULT_NAME_PREFIXES[getRandom(0, DEFAULT_NAME_PREFIXES.length)];
  const suffix = DEFAULT_NAME_SUFFIXES[getRandom(0, DEFAULT_NAME_SUFFIXES.length)];
  return `${prefix} ${suffix}`;
}
